Insert into JBGD.ITEM (ITEM_NO,ITEM_NAME,ITEM_PRICE,ITEM_STOCK,ITEM_CONTENT,ITEM_CRE_DATE,ITEM_MOD_DATE,ITEM_VIEW_COUNT,ITEM_SOLD_COUNT,ITEM_STATE) values (31,'약과',1500,2400,'약과란 중국 전국 시대의 노래인 초혼부(招魂賦)에 “거여(??)와 밀이(蜜餌)에 장황(??)도 있습니다.”고 하는 구절이 있습니다. 후한의 왕일(王逸)은 ‘거여’를 쌀가루를 꿀에 섞어 구운 것으로, ‘밀이’는 기장쌀을 꿀에 섞어 구운 것으로, ‘장황’을 엿[?]으로 보았다. 명나라의 가산(可山) 임홍(林洪)은 ‘거여’를 밀면(蜜?)을 말린 간로병(間爐餠)으로, ‘밀이’는 밀면보다 윤기가 더 있는 떡으로, ‘장황’은 한식에 먹는 한구(寒具)로 보았다. 이에 대해 이익은 《성호사설》에서 ‘거여’는 밀면을 기름에 튀긴 후에 말린 박계(朴桂)와, ‘밀이’는 거여와 같은 방식으로 만든 후에 엿과 꿀을 덧바른 약과와 비슷한 것으로 보았습니다.
Insert into JBGD.ITEM (ITEM_NO,ITEM_NAME,ITEM_PRICE,ITEM_STOCK,ITEM_CONTENT,ITEM_CRE_DATE,ITEM_MOD_DATE,ITEM_VIEW_COUNT,ITEM_SOLD_COUNT,ITEM_STATE) values (32,'붕어빵',1550,334,'이 붕어빵은 붕어빵 장인 한땀한땀 피땀눈물이 다들어간 그러한 붕어빵입니다. 모두다 한국에서 직접 키우고 재배 하고 농약 따윈 뿌리지 않은 순수 올가닉 푸드입니다 ㅎㅎ
